import { useState, useEffect } from 'react';
import axios from 'axios';
import { Container, Row, Col, Card, Modal, Button, FormControl, Form } from 'react-bootstrap';

const DogGallery = () => {
  const [dogs, setDogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [selectedDog, setSelectedDog] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    const fetchDogs = async () => {
      try {
        const response = await axios.get('/api/dogs');
        setDogs(response.data);
        setLoading(false);
      } catch (err) {
        setError(err.message);
        setLoading(false);
      }
    };

    fetchDogs();
  }, []);

  const handleCardClick = (dog) => {
    setSelectedDog(dog);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setSelectedDog(null);
    setShowModal(false);
  };

  const filteredDogs = dogs.filter(dog =>
    dog.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  if (loading) return <div>Loading...</div>;
  if (error) return <div>Error: {error}</div>;

  return (
    <Container>
      <div style={{margin: '10px 0 60px 0'}}>
        <h1>Dogs Gallery</h1>
        <Form inline className="mb-4">
          <FormControl
            type="text"
            placeholder="Search dogs"
            className="mr-sm-2"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
        </Form>
        <Row>
          {filteredDogs.map(dog => (
            <Col key={dog._id} sm={6} md={4} lg={3}>
              <Card style={{ marginBottom: '20px', cursor: 'pointer' }} onClick={() => handleCardClick(dog)}>
                <Card.Img variant="top" src={dog.image} style={{ height: '200px', objectFit: 'cover' }} />
                <Card.Body>
                  <Card.Title>{dog.name}</Card.Title>
                  <Card.Text>
                    <strong>Origin:</strong> {dog.place_of_found}
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>

        <Modal show={showModal} onHide={handleCloseModal}>
          <Modal.Header closeButton>
            <Modal.Title>{selectedDog && selectedDog.name}</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            {selectedDog && (
              <div>
                <p><strong>Breed:</strong> {selectedDog.breed}</p>
                <p><strong>Size:</strong> {selectedDog.size}</p>
                <p><strong>Life Expectancy:</strong> {selectedDog.life_expectancy}</p>
                <p><strong>Place of Found:</strong> {selectedDog.place_of_found}</p>
                <p><strong>Diet:</strong> {selectedDog.diet}</p>
                <p><strong>Description:</strong> {selectedDog.description}</p>
                <p><strong>Weight (kg):</strong> {selectedDog.weight_kg}</p>
                <p><strong>Height (cm):</strong> {selectedDog.height_cm}</p>
              </div>
            )}
          </Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={handleCloseModal}>
              Close
            </Button>
          </Modal.Footer>
        </Modal>
      </div>
    </Container>
  );
};

export default DogGallery;
